INSERT INTO `pi_wiki_notes` VALUES (1249,1688,'<p>Your challenge is to explore three samples of moon rock collected by Apollo astronauts and identify the main differences between them.</p>\r\n<p>You will have access to the Open Universitys Virtual Microscope, where you can inspect genuine slices of Moon rock at different magnifications.</p>\r\n<p>The nQuire inquiry learning system will guide you through the investigation, including browsing the samples, setting inquiry questions, choosing selecting snapshots of the samples, making measurements for comparison, and sharing your results with other investigators.</p>\r\n<iframe width=\"320\" height=\"180\" src=\"http://www.youtube.com/embed/evTLKNdgz88\" frameborder=\"0\" allowfullscreen></iframe>\r\n<p>In this video clip you can see astronauts Gene Cernan and Harrison Schmitt collecting samples during the Apollo 17 mission. This mission brought back to Earth more than 100kg of rock samples!</p>\r\n<p>You can find further information about Moon rocks on the web. Just search for moon rock for some fascinating information.</p>\r\n'),(1262,1703,'<p>Here you can think about what it is you will investigate and type in your decisions.</p>\r\n\r\n         <table>\r\n         <tr>\r\n         <td><center><iframe src=\"http://projects.kmi.open.ac.uk/microscope/sections/78235/\" width=\"300px\"></iframe><br /><h2>Sample A</h2></center></td>\r\n         <td><center><iframe src=\"http://projects.kmi.open.ac.uk/microscope/sections/70181/\" width=\"300px\"></iframe><br /><h2>Sample B</h2></center></td>\r\n         <td><center><iframe src=\"http://projects.kmi.open.ac.uk/microscope/sections/14503/\" width=\"300px\"></iframe><br /><h2>Sample C</h2></center></td>\r\n         </tr>\r\n         </table>\r\n\r\n'),(1416,1956,'<p>When studying rocks and minerals, from Earth or the Moon, geologists use a set of measures that help them collect and organize their data. In this inquiry, you can use some of the most common measures.</p><!--break-->\r\n\r\n<ul>\r\n<li><b>Longest dimension</b>: A measurement, in millimetres, of the longest dimension of a crystal that you can see in the snapshot.</li>\r\n<li><b>Colour</b>: A typical colour of rock in the snapshot (if the snapshot shows one or more colours you may want to zoom in until you get a single colour, or focus the snapshot on the feature that shows that colour). You will select the colour form a chart that Geologists use to describe rock samples.</li> \r\n<li><b>Opacity</b>: The slices that you can see here are 30 microns thick (0.030 millimeters). Thanks to this, we can distinguish between transparent minerals, which allow light to traverse then, and opaque minerals, which appear as black since no light passes through them.</li>\r\n<li><b>Crystal shape</b>: The shape of an individual crystal with the sample.</ul>\r\n \r\n<p>These are the formal measures. You can also make personal notes of other measures and features that may help you in answering your question, such as where the sample was found on the Moon.</p>\r\n<p>Remember that a rock sample may display different features in different positions. Therefore you may take several measures of each sample, to record this variations.</p>\r\n\r\n\r\n'),(1869,2502,'asdfdsg'),(1872,2507,'These are my personal conclusions...\r\n'),(1873,2508,'My notesfff'),(1419,1961,'my notes...fff'),(1421,1963,'These are my !!!'),(1422,1964,'asfdasdf fdaasdf as'),(1423,1966,'My conclusions...'),(1767,2310,'notsess asd '),(1768,2311,'javier notes'),(1778,2330,'eloy notes'),(1779,2334,'My conclusions...'),(1782,2337,'new student notes'),(1783,2338,'eloy student notes'),(1784,2339,'another student notes...'),(2344,3041,'dfg'),(2345,3043,'<p>We propose a challenge to you: <b>Explore four samples of moon rock collected by Apollo astronauts and identify the main differences between them</b>.</p>\r\n\r\n<table><tbody><tr><td style=\"vertical-align: bottom; text-align: center;\"><img src=\"moonrock_snapshots/sample_14053.jpg\" style=\"padding:2px; width: 100px; border: 1px solid gray; border-radius:3px; background: lightgray;\"></td><td style=\"vertical-align: bottom; text-align: center;\"><img src=\"moonrock_snapshots/sample_70181.jpg\" style=\"padding:2px; width: 100px; border: 1px solid gray; border-radius:3px; background: lightgray;\"></td><td style=\"vertical-align: bottom; text-align: center;\"><img src=\"moonrock_snapshots/sample_14310.jpg\" style=\"padding:2px; width: 100px; border: 1px solid gray; border-radius:3px; background: lightgray;\"></td><td style=\"vertical-align: bottom; text-align: center;\"><img src=\"moonrock_snapshots/sample_74220.jpg\" style=\"padding:2px; width: 100px; border: 1px solid gray; border-radius:3px; background: lightgray;\"></td></tr><tr><td style=\"vertical-align: bottom; text-align: center;\">Aluminium-rich basalt</td><td style=\"vertical-align: bottom; text-align: center;\">Mature mare regolith</td><td style=\"vertical-align: bottom; text-align: center;\">Impact melt breccia</td><td style=\"vertical-align: bottom; text-align: center;\">Orange spherule regolith</td></tr></tbody></table>\r\n\r\n<!--break-->\r\n<p>In this inquiry, you can inspect genuine slices of Moon rock at different magnifications, through the Open Universitys Virtual Microscope.</p>\r\n<p>The nQuire inquiry learning system will guide you through the investigation, including browsing the samples, setting inquiry questions, making measurements for comparison, and sharing your results with other investigators.</p>\r\n\r\n<table>\r\n<tr>\r\n<td style=\"vertical-align: bottom; text-align: center;\">\r\n<video width=\"320\" height=\"180\" controls=\"controls\">\r\n<source src=\"video/nquire.mp4\" type=\"video/mp4\">\r\n</video></td>\r\n<td style=\"vertical-align: bottom; text-align: center;\"><iframe width=\"320\" height=\"180\" src=\"http://www.youtube.com/embed/AM0-WQjj0hY?feature=player_detailpage\" frameborder=\"0\" allowfullscreen></iframe>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: bottom; text-align: center;\">Simon Kelley\'s introduction to nQuire</td><td style=\"vertical-align: bottom; text-align: center;\">Picking up samples from the Moon surface</td>\r\n</tr>\r\n</table>\r\n<p>In the video clip above you can see astronauts Gene Cernan and Harrison Schmitt collecting samples during the Apollo 17 mission. This mission brought back to Earth more than 100kg of rock samples!</p>\r\n<p>You can find further information about Moon rocks in the web. Just search for moon rock for some fascinating information.</p>'),(2346,3044,'saddf'),(2617,3378,'sdfdsaasdf'),(2619,3382,'I want to find about grain sizes and shapes');
/*!40000 ALTER TABLE `pi_wiki_notes` ENABLE KEYS */;
UNLOCK TABLES;

